INSERT INTO `movies` VALUES (29,'Cô Dâu Hào Môn','<p>Uyển Ân chính thức lên xe hoa trong thế giới thượng lưu của đạo diễn Vũ Ngọc Đãng qua bộ phim Cô Dâu Hào Môn.\r\n\r\nThừa thắng xông lên sau doanh thu trăm tỷ từ Chị Chị Em Em 2, nhà sản xuất Will Vũ và đạo diễn Vũ Ngọc Đãng bắt tay thực hiện dự án Cô Dâu Hào Môn. Bộ phim xoay quanh câu chuyện làm dâu nhà hào môn dưới góc nhìn hài hước và châm biếm, hé lộ những câu chuyện kén dâu chọn rể trong giới thượng lưu.\r\n\r\nPhối hợp cùng Uyển Ân ở các phân đoạn tình cảm trong bộ phim lần này là diễn viên Samuel An. Anh được đạo diễn Vũ Ngọc Đãng “đo ni đóng giày” cho vai cậu thiếu gia Bảo Hoàng với ngoại hình điển trai, phong cách lịch lãm và gia thế khủng.\r\n\r\nCùng góp mặt với Uyển Ân trong bộ phim đình đám lần này là sự xuất hiện của những cái tên bảo chứng phòng vé như: Thu Trang, Kiều Minh Tuấn, Samuel An, Lê Giang, NSND Hồng Vân,...\r\n\r\nPhim mới Cô Dâu Hào Môn suất chiếu sớm từ 16.10 (Không áp dụng Movie Voucher), dự kiến ra mắt tại các rạp chiếu phim từ 18.10.2024.</p>\r\n','2024-10-17 07:00:00',114,'Vũ Ngọc Đãng',8.2,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729067066/movies/jyk0fsgudjdiububxvji.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1726483838/movies/ugwezd7yduyzdm3qrfw0.mp4','2024-09-16 10:50:39','2024-10-16 15:50:25','movies/jyk0fsgudjdiububxvji',NULL),(42,'Tee Yod: Quỷ Ăn Tạng Phần 2','<p>Ba năm sau cái chết của Yam, Yak vẫn tiếp tục săn lùng linh hồn bí ẩn mặc áo choàng đen. Gặp một cô gái có triệu chứng giống Yam, Yak phát hiện ra người bảo vệ linh hồn, pháp sư ẩn dật Puang, sống trong một khu rừng đầy nguy hiểm. Giữa những phép thuật ma quỷ và những sinh vật nguy hiểm. Khi họ đuổi theo linh hồn mặc áo choàng đen, tiếng kêu đầy ám ảnh của Tee Yod sắp quay trở lại một lần nữa...\r\n\r\nPhim mới Tee Yod 2 / Tee Yod: Quỷ Ăn Tạng Phần 2 có suất chiếu đặc biệt từ 10-13.10.2024 (không áp dụng movie voucher) và khởi chiếu chính thức 18.10.2024 tại các rạp chiếu phim toàn quốc. </p>\r\n','2024-10-10 07:00:00',111,'Taweewat Wantha',9.4,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729067360/movies/aehikd6ddki0jpxngafh.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1726737425/movies/pcjjxdmu3hmv0okrmfah.mp4','2024-09-19 16:17:05','2024-10-16 15:50:43','movies/aehikd6ddki0jpxngafh','movies/pcjjxdmu3hmv0okrmfah'),(43,'Robot Hoang Dã','Cuộc phiêu lưu hoành tráng theo chân hành trình của một robot — đơn vị ROZZUM 7134, gọi tắt là Roz. Roz vô tình dạt vào hoang đảo sau một sự cố và nơi đây trở thành địa điểm sống mới của cô. Tại đây, Roz kết thân và nhận nuôi một chú ngỗng con, đặt tên là Brightbill. Roz và Brightbill dần dần thân thiết với các bạn thú trên đảo, song sau đó phải chống chọi, bảo vệ “nhà mới” trước sự xâm lăng của nhà máy từng sản xuất ra Roz.\r\n\r\nPhim mới The Wild Robot / Robot Hoang Dã có suất chiếu đặc biệt từ 05 - 06.10.2024 (không áp dụng movie voucher) và khởi chiếu chính thức 11.10.2024 tại các rạp chiếu phim trên toàn quốc. ','2024-10-11 07:00:00',102,'Chris Sanders',8.8,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729067472/movies/ctacsk5evxxsku8gancq.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1726833323/movies/f4riwlcue4yqd5pvu9wf.mp4','2024-09-19 22:11:36','2024-10-16 15:51:20','movies/ctacsk5evxxsku8gancq','movies/f4riwlcue4yqd5pvu9wf'),(44,' Domino: Lối Thoát Cuối Cùng','<p>Sau khi cha bị kẻ ác sát hại, từ người ngoài cuộc, An (Thuận Nguyễn) từng bước bị kéo vào cuộc chiến của các phe đảng xã hội đen. An một mình sẽ phải đối mặt với những nguy hiểm đe dọa đến cả tính mạng.\r\n\r\nPhim mới Domino: Lối Thoát Cuối Cùng dự kiến khởi chiếu 27.09.2024 tại các rạp chiếu phim toàn quốc. Cùng đặt lịch xem Domino: Lối Thoát Cuối Cùng.</p>\r\n','2024-10-11 07:00:00',103,'Nguyễn Phúc Huy Cương',7.0,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729067618/movies/uykbpektsubcqbccxo48.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1726842847/movies/nyhzmsy2o8iokugdqafp.mp4','2024-09-20 21:34:10','2024-10-16 15:51:51','movies/uykbpektsubcqbccxo48','movies/nyhzmsy2o8iokugdqafp'),(45,' Cám','<p>a</p>\r\n','2024-10-07 07:00:00',122,'Trần Hữu Tấn',7.0,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729067779/movies/k3qi2hqlne26vmiu9a8c.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1728465981/movies/fonvxarwjibxd5vxaggk.mp4','2024-10-09 16:26:22','2024-10-16 15:52:13','movies/k3qi2hqlne26vmiu9a8c','movies/fonvxarwjibxd5vxaggk'),(46,'Làm Giàu Với Ma','<p>Phim mới Làm Giàu Với Ma kể về Lanh (Tuấn Trần) - con trai của ông Đạo làm nghề mai táng (Hoài Linh), lâm vào đường cùng vì cờ bạc. Trong cơn túng quẫn, “duyên tình” đẩy đưa anh gặp một ma nữ (Diệp Bảo Ngọc) và cùng nhau thực hiện những “kèo thơm\" để phục vụ mục đích của cả hai.</p>\r\n','2024-10-14 07:00:00',112,'Trung Lùn',7.9,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729067886/movies/xpb4nxz8v4zsss89hufu.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1729058881/movies/bjo1xwe6yklvfn0rhhkb.mp4','2024-10-16 13:08:01','2024-10-16 15:52:34','movies/xpb4nxz8v4zsss89hufu','movies/bjo1xwe6yklvfn0rhhkb'),(47,'An Lạc','<p>Bộ phim đạt 3 giải thưởng danh giá tại SEA International Film Festival 2024 sẽ mang đến cho khán giả một câu chuyện đáng yêu về một thầy tu và một chú chó cùng song hành với nhau vượt qua những vui buồn, ganh ghét của cuộc sống xung quanh, cùng nhau tìm đến hạnh phúc của cuộc đời.</p>\r\n<p>Phim mới Kan Kaung / An Lạc dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 18.10.2024.</p>\r\n','2024-10-18 07:00:00',121,'Win Lwin Htet',7.0,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729068887/movies/gc7ueskzhc5jrczx6h5b.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1729068889/movies/qdk8bl4onamwzqy2tzvd.mp4','2024-10-16 15:54:50','2024-10-16 15:54:50','movies/gc7ueskzhc5jrczx6h5b','movies/qdk8bl4onamwzqy2tzvd'),(48,'Tín Hiệu Cầu Cứu','<p>&quot;Tín Hiệu Cầu Cứu&quot; theo chân cô phục vụ cocktail Frida (do Naomi Ackie thủ vai) đã phải lòng tỷ phú công nghệ tên Slater King (Channing Tatum thủ vai) và theo chân anh ta tới một hòn đảo thiên đường, với rất nhiều thú vui xa xỉ.</p>\r\n<p>Đời không như là mơ bởi hòn đảo thiên đường này lại là nơi dễ đến nhưng khó đi. Tỷ phú Slater King được nhiều người ngưỡng mộ lại đang che giấu một bí mật khủng khiếp. Khi bức màn bí ẩn càng được vén lên thì Frida càng gặp nhiều rắc rối, và một cuộc thanh trừng đẫm máu đã xảy ra tại hòn đảo thiên đường. Số phận của Frida sẽ đi về đâu?</p>\r\n<p>Phim mới Blink Twice / Tín Hiệu Cầu Cứu dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 18.10.2024.</p>\r\n','2024-10-18 07:00:00',103,'Zoë Kravitz',7.0,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729068988/movies/afjgymwl3z7vsu7cx8hc.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1729068991/movies/rvxohjzswg9wjmtruhaf.mp4','2024-10-16 15:56:31','2024-10-16 15:56:31','movies/afjgymwl3z7vsu7cx8hc','movies/rvxohjzswg9wjmtruhaf'),(49,'Bóng Đá Nữ Việt Nam: Chuyện Lần Đầu Kể','<p>Bóng Đá Nữ Việt Nam: Chuyện Lần Đầu Kể là cuốn hồi ký lưu giữ những khoảnh khắc bùng nổ tinh thần chiến đấu và niềm tự hào sắc tộc của đội tuyển bóng đá nữ trong hành trình kiến tạo dấu ấn lịch sử của thể thao Việt Nam.</p>\r\n<p>Phim mới Bóng Đá Nữ Việt Nam: Chuyện Lần Đầu Kể dự kiến ra mắt tại các rạp chiếu phim từ 18.10.2024.</p>\r\n','2024-10-18 07:00:00',75,'Nguyễn Thị Thắm',7.2,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729069185/movies/cgj9ps5b36amgd993k8i.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1729069190/movies/seezgyavsonn3e7xqn0p.mp4','2024-10-16 15:59:51','2024-10-16 15:59:51','movies/cgj9ps5b36amgd993k8i','movies/seezgyavsonn3e7xqn0p'),(50,' Elli Và Bí Ẩn Chiếc Tàu Ma','<p>Một cuộc truy đuổi của những chiếc drone bí ẩn đã bị bắt đi người chú thân thiết của hồn ma Elli bé bỏng. Quyết định rời khỏi căn biệt thự ma ám để giải cứu người chú đáng thương khiến cô bé dấn thân vào một chuyến phiêu lưu đầy gay go với những thách thức, cũng chính là cơ hội cô bé gặp gỡ những người bạn quái vật thú vị và khám phá được năng lực bí ẩn của chính mình. Liệu Elli có chiến thắng cuộc truy đuổi căng thẳng và đoàn tụ với người chú của mình? Câu trả lời sẽ có trong bộ phim “Elli And The Ghostly Ghost Train / Elli và Bí Ẩn Chiếc Tàu Ma”</p>\r\n<p>Phim mới Elli And The Ghostly Ghost Train / Elli Và Bí Ẩn Chiếc Tàu Ma dự kiến khởi chiếu 25.10.2024 tại các rạp chiếu phim toàn quốc. Cùng đặt lịch xem Elli And The Ghostly Ghost Train / Elli Và Bí Ẩn Chiếc Tàu Ma</p>\r\n','2024-10-25 07:00:00',120,'Jespe Møller',7.0,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729069315/movies/ay2cetv854e9j0xzf9pg.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1729069321/movies/akhf1ecgat9hpchiivcr.mp4','2024-10-16 16:02:02','2024-10-16 16:02:02','movies/ay2cetv854e9j0xzf9pg','movies/akhf1ecgat9hpchiivcr'),(51,' Mật Mã Đỏ','<p>Red One / Mật Mã Đỏ kể về Callum Drift, người đứng đầu lực lượng an ninh Bắc Cực , phải hợp tác với Jack O\'Malley, một thợ săn tiền thưởng , để tìm và giải cứu Ông già Noel sau khi ông bị bắt cóc.</p>\r\n<p>Phim mới Red One / Mật Mã Đỏ dự kiến khởi chiếu 15.11.2024 tại các rạp chiếu phim toàn quốc. Cùng đặt lịch xem Red One / Mật Mã Đỏ</p>\r\n','2024-11-15 07:00:00',120,'Jake Kasdan',8.6,'https://res.cloudinary.com/dqah4axnc/image/upload/v1729069453/movies/pxkbtjvhg5jlwefzn4u8.jpg','https://res.cloudinary.com/dqah4axnc/video/upload/v1729069456/movies/umdwz5raszpbvevj1jyd.mp4','2024-10-16 16:04:16','2024-10-16 16:04:16','movies/pxkbtjvhg5jlwefzn4u8','movies/umdwz5raszpbvevj1jyd');
